import{bindTabs}from"../default/script.js";bindTabs("#tabs1");const activeBtnPassword=document.querySelectorAll(".box-input button");activeBtnPassword.forEach(e=>{e.addEventListener("click",()=>{e.classList.toggle("active"),"password"===e.parentElement.firstElementChild.type?e.parentElement.firstElementChild.type="text":e.parentElement.firstElementChild.type="password"})});const privacyPolicy=document.querySelectorAll(".privacy-policy");privacyPolicy.forEach(e=>{e.onchange=()=>{let t=e.parentElement.parentElement.parentElement.parentElement.lastElementChild.firstElementChild;t.disabled=!t.disabled}});